INSERT INTO `posts` (`id`, `type`, `status`, `order`, `parent_id`, `fields`, `meta`, `created_at`, `updated_at`) VALUES (3, 'product', NULL, 0, NULL, '{\"title\": {\"en\": \"red lentil\", \"tr\": \"krmz mercimek\"}, \"banner\": \"S7KmgYE4psAYWWkUeeuWmQu6HqusgI-metaVmFybMSxayAyLmpwZw==-.jpg\", \"field_1\": {\"en\": null, \"tr\": \"Baklagiller familyasndan beyaz iekli bir bitki olan mercimek, mevsimi geldiinde ufak, yeil ya da krmz, yuvarlak ve yassca ekillerde tohum veren bir bitkidir. Mercimek, yetime koullar bakmndan scak lman iklim koullarnn hkim olduu blgelerde yetitirilen bir besindir. Mercimek yemeklik baklagiller ierisinde kuraa, scaa ve soua en dayankl olan gda maddesidir.\"}, \"field_2\": {\"en\": null, \"tr\": \"lkemizde yaz aylar, ok scak ve ya olmadndan yazlk mercimek yetitirilememektedir. lkemizde klk krmz mercimek retimi yaplmaktadr. Krmz mercimek ise lkemizde klk olarak iklim koullar bakmndan uygun olan Gney Dou Anadolu Blgesinde yetitirilmektedir. \"}, \"properties\": [{\"icon\": \"EyFCEDUFQN7r33eLkDnfHdvziSYLdD-metaVmFybMSxayA3LnBuZw==-.png\", \"text\": \"Protein ve karbonhidrat ierir.\"}, {\"icon\": \"j35MQRG6e2n3IvFhnCr2uwmom3sFKA-metaVmFybMSxayA2LnBuZw==-.png\", \"text\": \"B Vitamini erir\"}, {\"icon\": \"1lBEyt70wpnVosxvwlGLKbjogGg8Da-metaVmFybMSxayA1LnBuZw==-.png\", \"text\": \"Polifenoller ynnden zengindir.\"}, {\"icon\": \"tRn0cfs8CcbmZsUBrNulvwaQmBsstV-metaVmFybMSxayA0LnBuZw==-.png\", \"text\": \"Yksek lif ieriine sahiptir.\"}], \"field_1_img\": \"RqMmpLUqqZnMNRHxjbwJEVAe9XB4Ld-metaYWxhbjEucG5n-.png\", \"field_2_img\": \"CqTrWpSuhAlNDpvqqMVJkrtxBqRikE-metaYWxhbjIucG5n-.png\", \"alt_banner_img\": \"5pNQGqba4o1Q53BJKis3nfInDv8Wor-metaVmFybMSxayA4LnBuZw==-.png\", \"alt_banner_color\": \"#794108\", \"alt_banner_text_1\": {\"en\": null, \"tr\": \"MERCMEK, SICAK ve ILIMAN KLM \"}, \"alt_banner_text_2\": {\"en\": null, \"tr\": \"KOULLARINDA YETTRLR\"}}', NULL, '2023-06-04 22:52:48', '2023-06-06 10:37:30');
INSERT INTO `posts` (`id`, `type`, `status`, `order`, `parent_id`, `fields`, `meta`, `created_at`, `updated_at`) VALUES (4, 'product', NULL, 0, NULL, '{\"title\": {\"en\": null, \"tr\": \"nohut\"}, \"banner\": \"W12WuQHtiR5JoaZs0lt1B4q8haR7QV-metaVmFybMSxayA3LnBuZw==-.png\", \"field_1\": {\"en\": null, \"tr\": \"Baklagiller ailesinin protein ynnden en zengin yesidir. Dengeli ve salkl beslenme sz konusu olduunda, akla gelen ilk gdalar arasnda olan nohut, vcudun protein ihtiyacn fazlasyla karlamasnn yan sra, iinde bulunan vitaminlerle de k aylarnda vcudu destekleyicidir. Souk havalarda, tketimi vcut direnci artrr hatta yalanmaya kar da mcadele eder. nk E vitamini bakmndan olduka zengindir.\"}, \"field_2\": {\"en\": null, \"tr\": \"Nohut, demir, inko, magnezyum, fosfor ve kalsiyum da ierir. Baklk sistemini glendirici ve vcudu koruyuculuu bu minerallerden gelir. Anavatan Akdeniz, olarak bilinir. Scakl seven, scak hava koullarnda retimi yaplan bir besindir.\"}, \"properties\": [{\"icon\": \"9PXZjJheYuK8PAHSJ9HpeALMRoW2Zw-metaVmFybMSxayAxMS5wbmc=-.png\", \"text\": \"Kalsiyum ierir\"}, {\"icon\": \"Gmg2GGiGx8qNlrrbjuYfnYeNfG7jjJ-metaVmFybMSxayA5LnBuZw==-.png\", \"text\": \"magnezyum ierir\"}, {\"icon\": \"brpBZO8KtwWY7eQky8XwEGs8hQapQ3-metaVmFybMSxayAxMC5wbmc=-.png\", \"text\": \"K Vitamini ynnden zengindir\"}, {\"icon\": \"aj8CMcYGIC72q5vZiPke4RfEmHIjsE-metaVmFybMSxayAxMi5wbmc=-.png\", \"text\": \"Yksek lif ieriine sahiptir\"}], \"field_1_img\": \"Trz6cME6KLnNKeqm3uVCCT7RSmzOXJ-metaVmFybMSxayA0LnBuZw==-.png\", \"field_2_img\": \"riUZCqJwtt0KcRavpuIxGOqdQrdfgY-metaVmFybMSxayA4LnBuZw==-.png\", \"alt_banner_img\": \"2xiWVPebKOTNG8wHEEfwJOw2H5pI1P-metaVmFybMSxayAxMy5wbmc=-.png\", \"alt_banner_color\": \"#2C5660\", \"alt_banner_text_1\": {\"en\": null, \"tr\": \"NOHUT, DENGEL VE SALIKLI BESLENMEDE\"}, \"alt_banner_text_2\": {\"en\": null, \"tr\": \"ETKN ROL OYNAR\"}}', NULL, '2023-06-07 05:37:21', '2023-06-07 05:41:27');
INSERT INTO `posts` (`id`, `type`, `status`, `order`, `parent_id`, `fields`, `meta`, `created_at`, `updated_at`) VALUES (5, 'product', NULL, 0, NULL, '{\"title\": {\"en\": null, \"tr\": \"fasulye\"}, \"banner\": \"5GlElnua9UyACu7ho5ZVHndlB2E2CJ-metaVmFybMSxayA2LnBuZw==-.png\", \"field_1\": {\"en\": null, \"tr\": \"Bilim dnyasnda Phaseolus vulgaris ismi ile anlan fasulye, bir yl gibi uzun bir srede yetien taze ya da kuru tketilen sebzelerden biridir. Trkiyenin hemen her yerinde severek yenilen fasulye gerek kendi bahenizde yetitirebileceiniz gerekse marketlerden rahatlkla temin edebileceiniz besinlerden biridir.\"}, \"field_2\": {\"en\": null, \"tr\": \"Tyl ve kalp eklinde yapraklara sahip olan fasulye, yapraklarn sk aralarndan yetiir. Henz fasulye olumadan nce pembe, mor, beyaz iekler amaktadr. Meyvesini verdiinde iki temel tre ayrlan fasulye ya yass ve uzun ya da ksa ve tombul olmaktadr. Halk arasnda birbirinden farkl isimlerle anlan bu iki tr, lezzet bakmndan da bir hayli farkllk gstermektedir.\"}, \"properties\": [{\"icon\": \"weoLfboR2T2qkJP7HlnsmvV6vogv5d-metaVmFybMSxayAxMi5wbmc=-.png\", \"text\": \"Antioksidan ierir\"}, {\"icon\": \"9QUBOaRNhkGjrIdNfzaOF89xJjzXnv-metaVmFybMSxayA5LnBuZw==-.png\", \"text\": \"Kolestol drr\"}, {\"icon\": \"SMYLcJQOfCAzEUhDXO86aPgo1xVWmN-metaVmFybMSxayAxMS5wbmc=-.png\", \"text\": \"A Vitamini ynnden zengindir\"}, {\"icon\": \"IHxOHst1VbfeuAQKeKMoqpVEfU9bsR-metaVmFybMSxayAxMC5wbmc=-.png\", \"text\": \"C Vitamini ynnden zengindir\"}], \"field_1_img\": \"CkapOt7F8Myj8UqhzfNfLOILYe7ZRa-metaVmFybMSxayA3LnBuZw==-.png\", \"field_2_img\": \"QPXcsfyh0ApUGqchjoTlxuNiowYLUh-metaVmFybMSxayA4LnBuZw==-.png\", \"alt_banner_img\": \"scnGbdcm9TgrOWyKLEreSNlratQfXx-metaVmFybMSxayAxMy5wbmc=-.png\", \"alt_banner_color\": \"#466335\", \"alt_banner_text_1\": {\"en\": null, \"tr\": \"KURU FASULYE ENERJ VERR\"}, \"alt_banner_text_2\": {\"en\": null, \"tr\": null}}', NULL, '2023-06-07 05:53:48', '2023-06-07 05:53:48');
